Defendant Andrew E Qualls in court, in custody, with attorney Reisha Mitchell.   Abbey Nickolie appeared for the State of Wisconsin.    Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed by operation of law.  Counts 3, 4 and 5 are dismissed and read in.    Penalty enhancer on Count 1 struck by Court upon motion of the State.  
Statement by Gwen Q.  

The Court Orders the Following:

 5 Years Imprisonment (Credit - 73 days )
- 2 Years of Initial Confinement
- 3 Years of Extended Supervision

Conditions of Extended Supervision:
- AODA Assessment and follow through with any treatment recommended;
- Mental Health Evaluation and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Within 30 days be involved in a 12 step program and within 60 days have a sponsor/mentor;
- Obtain a valid driver's license;
- Operate a Motor Vehicle with a Valid Drivers License;
- Provide DNA sample if not yet provided  and pay surcharge

FINE:  $1582.00  
DNA Surcharge: $250.00
BLOOD DRAW FEE:  $35.00 to be paid through Waukesha County Circuit Court to be forwarded to  Menomonee Falls Police Department.
BAIL TO APPLY.  REMAINING BAIL TO BE REFUNDED TO POSTER

DL REVOCATION:  36 months.
IGNITITION INTERLOCK: 36 months.

Defendant to attend the Victim Impact Panel on: Within 90 days of release onto extended supervision.  Failure to attend 5 days Jail.

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
